import React from "react";
import { Container, Row, Col, Button } from "react-bootstrap";
import { Link } from "react-router-dom";

const CallToAction = () => {
  return (
    <section className="d-flex justify-content-center align-items-center min-vh-50 bg-primary text-white">
      <Container className="text-center">
        <Row className="justify-content-center align-items-center">
          <Col md={8}>
            <h2 className="fw-bold">Ready to Get Started?</h2>
            <p className="text-light">
              Join us today and take your career to the next level with our
              AI-powered CV analysis.
            </p>
            <Button as={Link} to="/register" variant="light" className="px-5">
              Sign Up Now
            </Button>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default CallToAction;
